import React from 'react'
import "./NAv.css"
function Nav() {

    return (
        <div className="nav">
            <img
            className="nav__logo"
            src="https://commons.wikimedia.org/wiki/Category:Netflix_logos#/media/File:Logonfx.png"
            alt="Netflix Logo"
        />
        <img 
        className="nav__avatar"
        src="https://pbs.twimg.com/profile_images/124011999041155"
        alt= "Netflix Logo"
        />
        </div>
    );
}

export default Nav;
